import React, { useEffect, useState } from 'react'
import {jwtDecode} from "jwt-decode";
import { handleError, handleSuccess } from '../../../../utils/utils';
import { ToastContainer } from 'react-toastify';
import { useNavigate } from 'react-router-dom';
import styles from './Profile.module.css';
import Navbar from '../../../../components/navbar/Navbar';
import Footer from '../../../../components/footer/Footer';

function Profile() {
    const token = localStorage.getItem("token");
    const decodedData = jwtDecode(token);

    const [supplierCommercialRegister, setSupplierCommercialRegister] = useState('');
    const navigate = useNavigate();

    const handleLogout = (e) => {
        localStorage.removeItem('token');
        localStorage.removeItem('role');
        handleSuccess('User Loggedout');
        setTimeout(() => {
            navigate('/supplier-login');
        }, 500)
    }

    const fetchCommercialRegister = async () => {
        try {
            const url = `http://localhost:8080/auth/supplier/supplier-commercial-register`;
            const headers = {
                headers: {
                    'Authorization': localStorage.getItem('token'),
                }
            }
            const response = await fetch(url, headers);
            const result = await response.json();
            console.log(result);
            setSupplierCommercialRegister(result);
        } catch (err) {
            handleError(err);
        }
    }

    useEffect(() => {
        fetchCommercialRegister();
    }, []);

    return(
        <section className={styles.profileBody}>
            <Navbar 
                two="Orders"
                two1="Under preparing orders"
                pathTwo1="/supplier/cement/under-preparing-orders"
                two2="Pending orders"
                pathTwo2="/supplier/cement/pending-orders"
                two3="Old orders"
                pathTwo3="/supplier/cement/old-orders"
                four="Profile"
                pathFour="/supplier/cement/profile"
                logout={handleLogout}
            />

            <div className={styles.profileContainer}>
                <div className={styles.profileRow}>
                    <h1 className={styles.profileH1}>{decodedData.supplierName} Profile</h1>
                    <p><strong>Supplier Name:</strong> {decodedData.supplierName}</p>
                    <p><strong>Supplier ID:</strong> {decodedData.supplierID}</p>
                    <p><strong>Email:</strong> {decodedData.email}</p>
                    <p><strong>Phone:</strong> {decodedData.supplierPhone}</p>
                    <p><strong>Product:</strong> {decodedData.supplierProduct}</p>
                    <p>
                        <strong>Commercial Register: </strong> 
                        <a href={`http://localhost:5000/uploads/${supplierCommercialRegister.commercialRegister}`} target="_blank" rel="noopener noreferrer">View PDF</a>
                    </p>
                    
                    <form className={styles.cementOrderForm} onSubmit= {handleCheckout}>
                                            <div className={styles.cementOrderDiv}>
                                                <label className={styles.cementOrderLabel} htmlFor='supplierName'>Supplier name</label>
                                                <select
                                                    className={styles.cementOrderSelect}
                                                    name="supplierName" 
                                                    onChange={handleChange}
                                                    value={inputValue.supplierName} 
                                                >
                                                    <option value="">Select an option</option>
                                                    {dataSupplier.map((supplier, index) => (
                                                        <option key={index} value={supplier.supplierName}>
                                                            {supplier.supplierName}
                                                        </option>
                                                    ))}
                                                </select>
                                            </div>
                                            <div className={styles.cementOrderDiv}>
                                                <label className={styles.cementOrderLabel} htmlFor='amountOfCement'>Enter the required amount of cement in ton</label>
                                                <input
                                                    className={styles.cementOrderInput}
                                                    onChange= {handleChange}
                                                    type='text'
                                                    name='amountOfCement' 
                                                    placeholder='Enter the required amount of cement in ton...'
                                                    value={inputValue.amountOfCement}
                                                    autoFocus
                                                />
                                            </div>
                                            <div className={styles.cementOrderDiv}>
                                                <p className={styles.cementOrderP}>20 bags of cement equals 1 ton</p>
                                            </div>
                                            <button className={styles.cementOrderButton} type='submit'>checkout</button>
                                        </form>

                </div>
            </div>

            <Footer 
                two="Orders"
                two1="Under preparing orders"
                pathTwo1="/supplier/cement/under-preparing-orders"
                two2="Pending orders"
                pathTwo2="/supplier/cement/pending-orders"
                two3="Old orders"
                pathTwo3="/supplier/cement/old-orders"
                four="Profile"
                pathFour="/supplier/cement/profile"
                logout={handleLogout}
            />
            <ToastContainer />
        </section>
    );
}

export { Profile };
